#define MODE_4 0x4
#define BG2_ENABLE 0x400
u16* paletteMem = (u16*)0x5000000;
u16* videoBuffer = (u16*)0x6000000;

void initColourPalette(void);
void drawBackground(void);
void plotPixel(int x, int y, unsigned short int c);
void processInput(void);
void putNumberOnOtherNumber(void);
void superMarioPrint(void);
void resetThisAwesomeGame(void);
int plusOneAmazingIncrement(int plusOneToMe);
int magicalTriforceDecrement(int negativeOneMePlz);
void resetRectangle(void);
int fairyNumber(int y, int x);

volatile int num1=0;
volatile int num2=0;
unsigned volatile int carry;
unsigned volatile int sum;

int main(void) {
	REG_DISPCNT = MODE_4 | BG2_ENABLE;
	initColourPalette();
	tte_init_bmp(MODE_4, &fwf_default, bmp8_drawg_default);
	tte_init_con();
	drawBackground();
	resetRectangle();
	tte_printf("#{P:5,5}");
	tte_printf("The Legend of Adda");
	while (1) {
		key_poll();
		processInput();
		superMarioPrint();
	}
	return 0;
}

void plotPixel(int x, int y, unsigned short int c) {
	videoBuffer[fairyNumber(y,x)] = (c);
}

void processInput(void) {
	if(key_hit(KEY_UP)) {
		resetRectangle();
		num1 = plusOneAmazingIncrement(num1);
	}
	if(key_hit(KEY_DOWN)) {
		resetRectangle();
		num1 = magicalTriforceDecrement(num1);
	}
	if(key_hit(KEY_LEFT)) {
		resetRectangle();
		num2 = magicalTriforceDecrement(num2);
	}
	if(key_hit(KEY_RIGHT)) {
		resetRectangle();
		num2 = plusOneAmazingIncrement(num2);
	}
	if(key_hit(KEY_START)) {
		resetRectangle();
		sum = num1 ^ num2;
		carry = num1 & num2;
		putNumberOnOtherNumber();
		resetThisAwesomeGame();
	}
}

void initColourPalette(void) {
	for(int triforce = 0; triforce < 256; triforce = plusOneAmazingIncrement(triforce)) {
		paletteMem[triforce] = trollink_palette[triforce];
	}
}

void drawBackground(void) {
	for(int y=0; y<160; y = plusOneAmazingIncrement(y)) {
		for(int x=0; x<120; x = plusOneAmazingIncrement(x)) {
			plotPixel(x, y, trollink[fairyNumber(y,x)]);
		}
	}
}

void putNumberOnOtherNumber(void) {
  while(carry != 0) {
    carry <<= 1;
    num1 = sum;
    num2 = carry;
    sum = num1 ^ num2;
    carry = num1 & num2;
  }
}

void superMarioPrint(void) {
	tte_printf("#{P:50,68}");
	tte_printf("%d", num1);
	tte_printf("#{P:50,78}");
	tte_printf("%d", num2);
	tte_printf("#{P:90,90}");
	tte_printf("%d", sum);
}

void resetThisAwesomeGame(void) {
	carry=0;
	num1=0;
	num2=0;
}

int plusOneAmazingIncrement(int plusOneToMe) {
  unsigned int plusOne=1;
  unsigned int masterSword, boomerang;
	masterSword = plusOneToMe ^ plusOne;
	boomerang = plusOneToMe & plusOne;
	while (boomerang != 0) {
			boomerang = boomerang << 1;
			plusOneToMe = masterSword;
			plusOne = boomerang;
			masterSword = plusOneToMe ^ plusOne;
			boomerang = plusOneToMe & plusOne;
	}
	return masterSword;
}

int magicalTriforceDecrement(int negativeOneMePlz) {
  int minusOne=-1;
  unsigned int ganon, link;
	ganon = negativeOneMePlz ^ minusOne;
	link = negativeOneMePlz & minusOne;
	while (link != 0) {
			link = link << 1;
			negativeOneMePlz = ganon;
			minusOne = link;
			ganon = negativeOneMePlz ^ minusOne;
			link = negativeOneMePlz & minusOne;
	}
	return ganon;
}

int fairyNumber(int y, int fairy) {
	int heart = y * 120;
  unsigned int ganon, link;
	ganon = heart ^ fairy;
	link = heart & fairy;
	while (link != 0) {
			link = link << 1;
			heart = ganon;
			fairy = link;
			ganon = heart ^ fairy;
			link = heart & fairy;
	}
	return ganon;
}

void resetRectangle(void) {
	tte_erase_rect(50, 68, 130, 100);
}
